											<div class="col-lg-6 col-12">
												<div class="imageElemsTabHomut">
													<img src="/img/homutovye-stroitelnye-lesa.jpg"
														alt="Клиновые леса ЛСК-60"
														title="Строительные леса клинового типа ЛСК-60. Произвести подробный расчет. Ознакомиться с ценами и техническими характеристиками и подробным описанием на сайте компании ООО ПК МДН-Пром">
													<div class="pointsTab">
