										<div class="col-sm-12">
											<div class="h4">
												<p>Строительные хомутовые леса по праву считаются одними из самых
													надежных, устойчивых и универсальных, несмотря на наличие других
													видов многоярусных подмостей! Им присущи многочисленные
													преимущества, в том числе и отличительные особенности, выделяющие
													вспомогательное оборудование среди аналогов. Представленная модель
													ЛХ-40 является популярной на отечественном рынке, и используется при
													широком перечне работ (отделка внутри помещений, монтаж, каменная
													кладка и т.д.). Максимальная высота установки каркаса – 40 м (для
													чего несущие детали производятся из прочных надежных труб). Его
													можно легко приспособить под форму нестандартных объектов, например,
													церквей или исторически значимых памятников.</p>
												<p>С помощью следующих элементов происходит сборка хомутовых лесов:</p>

												<ol>
													<li>Несущие стойки – вертикальные трубы (мощные, покрытые
														коррозиестойкой краской или цинком), обеспечивающие сборку
														подмостей по высоте. Стыкуются друг с другом методом «труба в
														трубу» до достижения максимальной или (необходимой) высоты. Не
														включают в свой состав фланцы, флажки и прочие атрибуты других
														видов лесов;</li>
													<li>Связи горизонтальные – трубчатые элементы, скрепляющие две
														противоположные стойки. Для этого применяются хомуты (глухие и
														поворотные), одна часть которых крепится к вертикали, а другая –
														к горизонтали;</li>
													<li>Связи диагональные – трубы, крепящиеся по диагонали для
														увеличения степени жесткости каркаса. Принцип соединения
														аналогичен с горизонталями;</li>
													<li>Настилы (из древесины) – собранные из досок поверхности, на
														которых непосредственно размещаются люди с необходимыми
														инструментами и строительными материалами. Обрабатываются
														специальными средствами, и могут использоваться на протяжении
														многих лет без ухудшения качества. Нередко встречаются аналоги
														из металла – стальные перфорированные настилы, покрывающиеся
														антикоррозийной краской или слоем цинка;</li>
													<li>Подпятники – устанавливающиеся в самом начале монтажа элементы,
														с помощью которых осуществляется распределение нагрузки под
														металлоконструкциями. Состоят из укладывающихся на землю
														квадратных стальных пластин, посередине которых приварены
														круглые патрубки под вертикаль. Второе название – башмаки;</li>
													<li>Лестницы – металлоизделия, устанавливающиеся для перемещения
														работников между ярусами. Как правило, бывают навесными
														(наиболее выгодный в финансовом плане вариант);</li>
													<li>Ограждения – специальные загораживающие элементы для рабочих
														ярусов, предотвращающие падение людей с высоты;</li>
													<li>Стартовые элементы – металлоизделия, на которые устанавливаются
														самые нижние вертикали.</li>
												</ol>

												<p>Важно заметить, что такие инвентарные леса долго устанавливаются, так
													как многочисленные хомуты требуют ответственности и предельной
													внимательности от монтажников. Зато собранные подмости
													характеризуются исключительной устойчивостью, универсальностью и
													безопасностью. С ними можно осуществлять самые сложные и нагрузочные
													работы, обходить нестандартные фасады, в связи с чем леса хомутового
													типа уверенно удерживают позиции на мировом рынке!</p>
